var doc = new jsPDF( 'landscape' );        

// Demo Data
var data = {
	name		: 'Adrian Hana',
	class		: '1B',
    year		: '2015/2016',
	
	template	: 'fancy' // can be fancy or lite
};

// Templates    
var template_fancy  = 'data:image/jpeg;base64,';
var template_lite   = 'data:image/jpeg;base64,';

var name		    = 'Name: ' + data.name,
	klass		    = 'Klasse: ' + data.class,
	year		    = 'Schuljahr: ' + data.year;

// add background (template)
if( data.template == 'fancy' ) {
	doc.addImage( template_fancy, 'JPEG', 0, 0, 297, 210 );
} else if( data.template == 'lite' ) {
	doc.addImage( template_lite, 'JPEG', 0, 0, 297, 210 );
}

// add info
doc.setFontSize( 16 );
doc.setTextColor( 255 );

doc.text( name, 200, 20 );
doc.text( klass, 200, 30 );
doc.text( year, 200, 40 );